    }

      height: 300px;
      background: white;
      border-radius: 8px;
      padding: 20px;
      margin: 20px 0;
      box-shadow: 0 2px 8px rgba(0,0,0,0.1);

      padding: 15px;
      margin: 15px 0;

      border-radius: 4px;
      padding: 15px;
      margin: 15px 0;
    }
    .layout-preview {
      background: white;
      border-radius: 8px;
      padding: 20px;
      margin: 20px 0;
      box-shadow: 0 2px 8px rgba(0,0,0,0.1);
      overflow: auto;
    }
    .metric {
      display: inline-block;
      margin: 10px 20px 10px 0;
    }
    .metric-value {
      font-size: 1.5rem;
      font-weight: bold;
      color: #007bff;
    }
    .metric-label {
      color: #6c757d;
      font-size: 0.9rem;
    }
    table {
      width: 100%;
      border-collapse: collapse;
      margin: 15px 0;
    }
    th, td {
      text-align: left;
      padding: 8px;
      border-bottom: 1px solid #dee2e6;
    }
    th {
      background-color: #f8f9fa;
      font-weight: 600;
    }
    .tag {
      display: inline-block;
      padding: 2px 8px;
      background: #e9ecef;
      border-radius: 3px;
      font-size: 0.85rem;
      margin: 2px;
